local tonumber = tonumber

module("FFN")
local FFN = _M

--[[ FFN constants ]]

FFN.home = "http://www.fanfiction.net/"
FFN.atom = FFN.home .. "atom/"

--[[ FFN helper functions ]]

function FFN.justIn(category, content, language)
   category = tonumber(category) or 0
   content  = tonumber(content)  or 0
   language = tonumber(language) or 0

   if not category then return nil end

   return ("feed/justin/%08d.xml"):format(category),
      FFN.atom .. ("j/%d/%d/%d/"):format(category, content, language)
end

function FFN.list(category, rating, genre, language, sort, length, status)
   category = tonumber(category)
   rating   = tonumber(rating)   or 3
   genre    = tonumber(genre)    or 0
   language = tonumber(language) or 0
   sort     = tonumber(sort)     or 1
   length   = tonumber(length)   or 0
   status   = tonumber(status)   or 0

   if not category then return nil end

   return ("feed/list/%08d.xml"):format(category),
      FFN.atom .. ("l/%d/%d/%d/%d/%d/%d/0/0/%d/0/1/"):format(
         category, rating, genre, language, sort, length, status)

end

function FFN.author(uid)
   uid = tonumber(uid)

   if not uid then return nil end

   return ("feed/user/%08d.xml"):format(uid), FFN.atom .. ("u/%d/"):format(uid)
end

function FFN.chapter(sid, num)
   sid = tonumber(sid)
   num = tonumber(num)

   if not (sid and num) then return nil end

   return ("story/%08d/%08d"):format(sid, num),
      FFN.home .. ("s/%d/%d/"):format(sid, num)
end

function FFN.userid(uri)
   return tonumber(uri:match('/u/(%d+)/'))
end

function FFN.storyid(uri)
   return tonumber(uri:match('/s/(%d+)/'))
end

